      "localizations": {
        "de": {
          "title": "ICON 4 | FINALE | EP. 2 | Das bedeutet Krieg (Team Hamdi VS Team Bobby)",
          "description": "Bei 10k Likes Kündigt Xandro bei Aldi 🥵\n\n➤ 𝗦𝗣𝗢𝗧𝗜𝗙𝗬: https://sptfy.com/Lp7F\n➤ 𝗜𝗖𝗢𝗡 𝟱 𝗔𝗡𝗠𝗘𝗟𝗗𝗨𝗡𝗚: https://icon-music.de/\n➤ 𝗠𝗘𝗥𝗖𝗛: https://iiicon.shop/\n➤ 𝗧𝗜𝗖𝗞𝗘𝗧𝗦: https://icon4.eventbrite.ca/\n         ↪ (\"EARLYBIRD50\" 𝗕𝗘𝗡𝗨𝗧𝗭𝗘𝗡 𝗕𝗘𝗜 𝗖𝗛𝗘𝗖𝗞𝗢𝗨𝗧 𝗨𝗠 𝟱𝟬% 𝗭𝗨 𝗦𝗣𝗔𝗥𝗘𝗡)\n\n𝗞𝗔𝗣𝗜𝗧𝗘𝗟 𝗔𝗨𝗦𝗪𝗔𝗛𝗟:\n0:00 Intro & Challenge Beschreibung\n3:13 Challenge Vorbereitung\n7:36 Battle 1 Künstlerwahl\n9:26 Dreamerscartel X Wassim63 X Yassine\n12:48 Auswertung\n14:30 Mowgli018 X Obby\n17:21 Auswertung\n18:06 Battle 2 Künstlerauswahl \n20:20 SanAndreas X Dorian - Krankenwagen\n22:46 Auswertung\n24:01 Bobby Vandamme X Tano77 X Kenan X Mohams X Adaver - Versuch 1 & 2\n26:25 Polizeibesuch bei ICON 4 & Team Besprechung\n28:07 Bobby Vandamme X Tano77 X Kenan X Mohams X Adaver - Kriminal\n31:16 Auswertung\n34:04 Battle 3 Künstlerauswahl \n35:32 Queris X Hamdi52 - Viel zu Spät\n38:22 Auswertung\n39:26 Tano77 X Mohams X Bobby Vandamme X Obby X Mowgli018 X Kenan - Überfälle fallen spontan\n42:00 Auswertung\n43:44 Interview Kenan\n44:39 Voting\n46:50 Preview Episode 3\n\n𝗕𝗘𝗦𝗖𝗛𝗥𝗘𝗜𝗕𝗨𝗡𝗚:\nIm ICON 4 Finale folge 4, stellen wir die 14 ICON Finalisten Mohams, Obby, Tano77, Queris, Mowgli018, Hamdi, SanAndreas, Dreamerscartel, Dorian, Bobby Vandamme, Hamdi52, Kenan, Yassine, Adaver und Wassim63 durch eine Reihe von Challenges auf die Probe. \n\nWir haben die Finalisten zu einer Villa in Belgien eingeladen. Dort verbringen Sie 8 Tage und müssen im Team sowohl als auch in Solo Challenges beweisen, dass Sie das zeug dazu haben den ICON Titel sowie die 5000 Euro in Preisgeld mit nachhause zu nehmen.\n\nDas ICON 4 Finale wird gehostet von Calien und bewertet durch Jury Xandro, Emre und Bzet.\n\n𝗘𝗜𝗡 𝗪𝗢𝗥𝗧 𝗔𝗡 𝗔𝗟𝗟𝗘 𝗭𝗨𝗦𝗖𝗛𝗔𝗨𝗘𝗥:\nWir möchten uns in erster Linie bei euch dem Publikum bedanken, denn ohne euch wäre das ganze nicht möglich. Wir sehen jeden Tag dass ihr genauso mit Herz in diesem Projekt drin steckt wie wir auch. Alle die uns supporten und an uns glauben - wir danken euch vom Herzen, denn ihr gebt uns die Kraft weiter zu machen auch wenn es manchmal echt hart ist.\n\n𝗘𝗜𝗡 𝗪𝗢𝗥𝗧 𝗔𝗡 𝗗𝗜𝗘 𝗖𝗥𝗘𝗪:\nIch möchte mich herzlich bedanken an jeden unserer Crew Mitglieder die mit Herz und Seele dabei sind und die Woche mit uns durchgehalten haben. Die Budgets sind grauenhaft, die Arbeitskonditionen noch härter mit teilweise viel zu wenig Schlaf weil ich euch viel zu früh geweckt habe. Aber ihr habt es geschafft, ihr seid ein Teil von einem besonderen Projekt dass euch keiner weg nehmen kann und jeder sollte stolz darauf sein. \nIch bin euch wirklich dankbar, denn ohne eure Arbeit wäre das ganze nicht möglich gewesen.\n\n𝗗𝗜𝗘 𝗖𝗥𝗘𝗪:\nCalien (Made2Create) - Organisation, Planung, Audio, Künstler Management\nXandro (Made2Create) - Organisation, Planung, Künstler Management, Mixing Mastering, Versorgung, Jury Mitglied\nEmre - Jury Mitglied, Location Scouting\nBzet - Jury Mitglied\nJonas (DIM Creator) - Filmcrew Management, Organisation, Kamera\nAR¥34 (34filim) - Kamera\nStefan & Verena (LUX Düsseldorf) - Kamera\nDavid (VisualFilms) - Kamera\n\nDanke an Alle Künstler für euer Vertrauen und Hingabe zum Projekt:\n\nMohams\nObby\nTano77\nQueris\nMowgli018\nHamdi52\nSanAndreas\nDreamerscartel\nDorian\nBobby Vandamme\nHamdi52\nKenan\nWassim63\n\nIch hoffe euch allen gefällt was wir alle zusammen in einem der größten kollaborativen Projekte auf Youtube gemacht haben. Viel spaß beim zuschauen!\n icon 3 made entertainment german charts deutschrap releases mctv deutschrap jay jiggy official charts"
